import React from "react";
import { Navbar } from "../../components/Navbar/Navbar";
import "./Search.scss";

export const Search: React.FC = () => {
  return (
    <div className="searchContainer">
      <Navbar />
      <div className="container">
        <div>Search for a video</div>
        <div>Search form</div>
      </div>
    </div>
  );
};
